Infection supports only a set of Mutators which are based on AST and [PHP-Parser](https://github.com/nikic/PHP-Parser) project. In such situation library users can't use their own mutators (which may be useful in their projects but doesn't fit to be a part of the library).
This PR adds the ability to use custom mutators in projects that use the infection library.
Custom mutators should implement `Infection\Mutator\Mutator` interface.

To use custom mutators, user must add them to the mutator list in the infection config. User has to use the class name with the namespace of the custom mutator as a name of mutator in the config. An example of using a custom mutator in the infection config:
```
{
    "mutators": {
        "App\\Infection\\MyFirstCustomMutator": true,
        "App\\Infection\\MySecondCustomMutator": {
            "ignore": [
                "*Controller::*",
            ]
        }
    }
}
```

Hi,

I hoped to mock die() function (or exit), seems not possible. I got that :

```php
namespace cool;

use phpmock\\generator\\MockFunctionGenerator;

function exit()
{
    $arguments = [];

    $variadics = \\array_slice(\\func_get_args(), \\count($arguments));
    $arguments = \\array_merge($arguments, $variadics);

    return MockFunctionGenerator::call(
        \'exit\',
        \'cool\\exit\',
        $arguments
    );
}
```

